//Componente que contiene la interfaz de una barra de navegación superior, con varios botones

import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
    return (
        <div className="navbar">
            <ul className="navbar-list">
                <li className="navbar-item"><Link to="/">Portada</Link></li>
                <li className="navbar-item"><Link to="/users">Libros</Link></li>
                <li className="navbar-item"><Link to="/user">Autores</Link></li>
                <li className="navbar-item"><Link to="/user">Géneros</Link></li>
            </ul>
        </div>
    );
}
